import React from 'react'

const ReadOnlyRow = ({ asset }) => {
    return (
        <tr>
            <td>{asset.inventoryNum}</td>
            <td>${asset.cost}</td>
            <td>{asset.name}</td>
            <td>{asset.model}</td>
        </tr>
    )
}

export default ReadOnlyRow
